import React from 'react';

const FloatingButton = () => {
    return (
      <button style={{
        position: 'fixed',
        bottom: '20px',
        right: '20px',
        width: '60px',
        height: '60px',
        borderRadius: '50%',
        backgroundColor: '#007aff',
        outline: 'none',
        border: 'none',
        boxShadow: '0 2px 4px rgba(0,0,0,0.24)',
        cursor: 'pointer',
        transition: 'all 0.3s ease-in-out',
      }}>
        <span style={{
          position: 'absolute',
          top: '50%',
          left: '50%',
          transform: 'translate(-50%, -50%)',
          fontSize: '32px',
          color: 'white',
          transition: 'all 0.3s ease-in-out',
        }}>
          +
        </span>
      </button>
    );
  };

export default FloatingButton;
